import self from '../img/guy.png';

let colors = "rgb(185, 85, 211), rgb(247, 10, 7)";


export const info = {
    firstName: "John",
    initials: "lb",
    position: "Full Stack Developer",
    selfPortrait: self,
    gradient: `linear-gradient(135deg, ${colors})`,
}
